void Vverilator_tb::trace (VerilatedVcdC* tfp, int, int) {
    tfp->spTrace()->addCallback (&Vverilator_tb::traceInit, &Vverilator_tb::traceFull, &Vverilator_tb::traceChg, this);
}
void Vverilator_tb::traceInit(VerilatedVcd* vcdp, void* userthis, uint32_t code) {
    // Callback from vcd->open()
    Vverilator_tb* t=(Vverilator_tb*)userthis;
    Vverilator_tb__Syms* __restrict vlSymsp = t->__VlSymsp; // Setup global symbol table
    if (!Verilated::calcUnusedSigs()) vl_fatal(__FILE__,__LINE__,__FILE__,"Turning on wave traces requires Verilated::traceEverOn(true) call before time 0.");
    vcdp->scopeEscape(' ');
    t->traceInitThis (vlSymsp, vcdp, code);
    vcdp->scopeEscape('.');
}
void Vverilator_tb::traceFull(VerilatedVcd* vcdp, void* userthis, uint32_t code) {
    // Callback from vcd->dump()
    Vverilator_tb* t=(Vverilator_tb*)userthis;
    Vverilator_tb__Syms* __restrict vlSymsp = t->__VlSymsp; // Setup global symbol table
    t->traceFullThis (vlSymsp, vcdp, code);
}

